//import "./App.css";
import Expense from "..//components/Expense";


function App() {
  const expenses = [
    {
      id: "e1 ",
      title: "Toilet Paper",
      amount: 245,
      date: new Date(2020, 7, 14),
    },
    {
      id: "e2",
      title: "Sachet Paper",
      amount: 845,
      date: new Date(2020, 7, 14),
    },
    {
      id: "e3",
      title: "New Paper",
      amount: 765,
      date: new Date(2020, 7, 14),
    },
    {
      id: "e4",
      title: "Old Paper",
      amount: 900,
      date: new Date(2020, 7, 14),
    },
  ];

  return (
    <div>
      <Expense items = {expenses}/>
    </div>
  );
}

export default App;
